window.bookSummaryJSON = "<p><b>Best-selling romance maestro Lauren Blakely returns with an Audible Original packed with the charm, chemistry, and comedy fans have come to know and love - brought to life by Hall of Fame narrator Andi Arndt and audio heartthrob Zachary Webber.</b></p> <p>Kristen Leonard is done with setups. She’s not interested in your son or your nephew or your butcher or the guy who mows your lawn, thank you very much, grandma! After all, she’s a modern woman - she’ll take her chances on the algorithms of online dating to find her ideal man. Before long, she meets a man who might just be the one - he’s hilarious, quick-witted, and full of heart. And when she meets up with Cameron in real life, he certainly looks exactly like his profile picture...but something’s not quite right.</p> <p>There’s really no telling what brought them together, and all bets are off as to whether or not they can trust their hearts over their heads. After all, can you fall in love with someone you’re not sure you really even know?</p>"; 
